function parseFloatGr(n){if(n===undefined||n===null)return console.info("file convert_float.js value pass is empty"),0;if(typeof n!="string")return console.info(`file convert_float.js val is not a string ${n}`),n;let t=n;return t.includes(".")&&t.includes(",")?t=t.replace(".",""):t.includes(".")&&(t=t.replace(".",",")),t.toFloat()}